import React from 'react';

import Crd from '../Components/Card';
import Container from 'react-bootstrap/Container';



class Experience extends React.Component{
    constructor(props){
        super (props);
    }

    render(){
        return(
            <div>
                <h5 className="font-weight-bolder">Recent Experience</h5>
                <Container fluid = {true}>
                    <Crd title = "Undergraduate Student Researcher" company = "Arizona State University" time = "[August 2019 - Current]" text = "blah blah blah" />
                </Container>
            </div>
        );
    }
}



export default Experience;
